import {Link} from "react-router-dom";
import {useState} from "react";

export default function DayList() {
    const {days, setDays} = useState([]);
    return (
        <ul className="list_day">
        {
            days.map(days => (
                <li key={days.id}>
                    <Link to={`/day/${days.day}`}> Day {days.day} </Link>
                </li>
            ))
        }
    </ul>
    );
}
